module menu_display(
    input clk,
    input slow_clk,
    input [2:0] main_menu_option,
    input [12:0] pixel_index,
    input [2:0] current_option,
    input btnD, btnU,
    input [11:0] xpos, 
    input [11:0] ypos,
    input [7:0] x, 
    input [7:0] y,
    input [31:0] scroll_count,
    output reg [15:0] rgb
    );
   
    reg [31:0] char_count = 0;
    reg [1:0] frame_count = 0;
    reg slow = 0;
    wire cursor;
   
    assign cursor = ( ((y >= ypos && y <= ypos + 5) && (x >= xpos) && (x <= xpos + 5)) &&
                           !((y == ypos + 2) && (x >= xpos + 4) && (x <= xpos + 5)) &&
                           !((y == ypos + 3) && (x == xpos + 5)) &&
                           !((y == ypos + 4) && (x == xpos + 2)) &&
                           !((y == ypos + 5) && (x >= xpos + 2) && (x <= xpos + 3)) );

    always @ (posedge slow_clk) begin
        slow = slow + 1;
        frame_count = slow ? frame_count == 3 ? 0 : frame_count + 1 : frame_count;
    end
    
    always @ (posedge clk) begin
        if (current_option == 0) begin
            char_count = pixel_index;
            char_count = char_count + 96 * scroll_count;
